import React, { Component } from "react";
import "./App.css";
import Market from "./component/Market";
import Sell from "./component/Sell";
import Buy from "./component/Buy";

class App extends Component {
  render() {
    return (
      <div>
        <div class="row">
          <div class="column">
          <center><h1>BTC to IDR</h1>
          <h2 className="h2"><i class="fab fa-bitcoin"></i>itcoin Market</h2>
          </center>
          </div>
          <div class="column">
          <Market />
          </div>
        </div>

        <div class="row">
          <div class="column">
            <Sell />
          </div>
          <div class="column">
            <Buy />
          </div>
        </div>
        <br/><br/><br/><br/>
      </div>
    );
  }
}
export default App;
